import React from "react";
import ContactShort from "../../components/shorts/contactshort/ContactShort";
import Header from "../../components/navbar/Header";

function Contact() {
  return (
    <React.Fragment>
      <Header />
      <ContactShort />
    </React.Fragment>
  );
}

export default Contact;
